import React from 'react';

import Mei from "./maanden/mei.jsx";
import Appbar from "./appbar.jsx"
  
class Osman extends React.Component {
  render() {    
    return (
        <div>
          <Appbar />
          <section><h1>Mei</h1></section>
          <Mei />
          <section><h1>Mei</h1></section>
          <Mei />
        </div>
    );
  }
}

export default (Osman);
